var results1 = [] 
var results2 = []

class GraphPage extends React.Component {

  constructor(props) {
    super(props)

    this.state = {
      numProductResults: [],
      avgPriceResults: [],
      numData: [],
      priceData: [],
    }


  }



  componentDidMount() {

    // route for the number of products per category
    /*
    getNumProducts().then(res => {

        results1 = res.results;
        console.log(res.results)
        for (var i = 0; i < results1.length; i++) {
          console.log("iteration", i)
          this.setState({ 
            numData: this.state.numData.concat([{name: results1[i].category2, uv: results1[i].NumProducts}])
          })
        }

        console.log("numData", this.state.numData)


    })
      */

      // average price route
      getAvgPrice().then(res => {
        console.log("avgPrice", res.results)

        results2 = res.results;
        console.log(res.results)
        for (var i = 0; i < results2.length; i++) {
          console.log("iteration", i)
          this.setState({ 
            priceData: this.state.priceData.concat([{name: results2[i].category2, uv: results2[i].AvgPricePerCategory}])
          })
        }

        console.log("priceData", this.state.priceData)


      })

  }


  render() {
    const blueText = {color: '#1e8d9e'}

    return (
      <div>
        <MenuBar />

          <Row>
        <div>
                <canvas style={{ width: '512px', height: '50px' }}></canvas>
                <h2
                  style={{
                    fontSize: '30px',
                    fontWeight: 'bold',
                    textAlign: 'left',
                    padding: '10px',
                    color: blueText
                  }}
                >
                  {' '}
                  Average Price Per Category:{' '}
                </h2>
                <LineChart width={500} height={300} data={this.state.priceData}>
                    <XAxis dataKey="name"/>
                    <YAxis/>
                    <CartesianGrid stroke="#eee" strokeDasharray="5 5"/>
                    <Line type="monotone" dataKey="uv" stroke="#8884d8" />
                    <Line type="monotone" dataKey="pv" stroke="#82ca9d" />
                    <Tooltip />
                </LineChart>
              </div>
      <div>
        <canvas style={{ width: '512px', height: '50px' }}></canvas>
        <h2
          style={{
            fontSize: '30px',
            fontWeight: 'bold',
            textAlign: 'right',
            padding: '10px',
          }}
        >
          {' '}
          Number of Products Per Category:{' '}
        </h2>
        <LineChart width={500} height={300} data={this.state.numData}>
            <XAxis dataKey="name"/>
            <YAxis/>
            <CartesianGrid stroke="#eee" strokeDasharray="5 5"/>
            <Line type="monotone" dataKey="uv" stroke="#8884d8" />
            <Line type="monotone" dataKey="pv" stroke="#82ca9d" />
            <Tooltip />
        </LineChart>
      </div>
      </Row>
    </div>

    )
  }

}

export default GraphPage
